# cli.py

import click
from db import get_db_connection


@click.group()
def cli():
    pass


@cli.command()
def show_tables():
    conn = get_db_connection()
    cursor = conn.cursor()
    cursor.execute('SHOW TABLES')
    for table in cursor.fetchall():
        print(table)
    cursor.close()
    conn.close()


if __name__ == '__main__':
    cli()
